syntax = "proto3";

option java_package = "com.vv.personal.twm.artifactory.generated.tw";
option java_outer_classname = "HtmlDataParcelProto";

message Parcel {
  string wallPageSource = 1;
  string snobPageSource = 2;
  string trainPageSource = 3;
  string farmPageSource = 4;
  string supportReportSource = 5;
  string marketPageSource = 6;

  repeated string adhocExtracData = 7;
}